import React from 'react';
import { Link } from 'react-router-dom';
import '../../styles/navbar.css';

function Navbar() {
  return (
    <nav className="fade-in-down" style={{
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '20px 40px',
      maxWidth: '1400px',
      margin: '0 auto',
      backgroundColor: 'transparent',
      zIndex: 10,
      position: 'relative',
    }}>
      <Link to="/" className="logo-animation" style={{
        fontSize: '24px',
        fontWeight: 'bold',
        textDecoration: 'none',
        color: '#FFFFFF',
        display: 'flex',
        alignItems: 'center',
        gap: '8px'
      }}>
        <span style={{ color: '#5CE1E6' }}>DS</span>
        <span>Portfolio</span>
      </Link>

      <div className="nav-links" style={{
        display: 'flex',
        gap: '40px',
      }}>
        {['Projects', 'Analysis', 'Models', 'Contact'].map((item) => (
          <Link
            key={item}
            to={`/${item.toLowerCase()}`}
            style={{
              color: '#FFFFFF',
              textDecoration: 'none',
              fontSize: '16px',
              fontWeight: '500',
              transition: 'color 0.3s ease',
              position: 'relative',
              padding: '8px 0',
            }}
            className="nav-link"
          >
            {item}
          </Link>
        ))}
      </div>
    </nav>
  );
}

export default Navbar;
